// Importing ReactDOM package that is present in package.json as a dependency
import ReactDOM from 'react-dom/client';

import './index.css';
import App from './App';

const root = ReactDOM.createRoot(document.getElementById('root'));

// we can call the render method to tell React what should be 
// rendered in that div that we selected above
// This (<App />) is JSX syntax here.
root.render(<App />);
// It will be our so-called, root Component,
// which means it's the main Component being rendered here
// in our starting file in index JS.
